import React from 'react'
import { Card } from 'antd'
import styled from "@emotion/styled";

const Details = () => {
  return (
    <div>
      <Card title="Income" bordered={false} style={{ width: 300, borderBottom:'4px #666' }}>
        <p>Card content</p>
      </Card>
    </div>
  )
}

export default Details
